import React from "react";

function Emoji(props){
    return (
    <div className="all">
    <h2>{props.id}</h2>
    <h1>{props.Emoji}</h1>
    <h3>{props.name}</h3>
    <p>{props.meaning}</p>

 

</div>
);
}
export default Emoji;
